import React from 'react';

type ButtonType = {
    onClick: ()=> void
    title: string
    color: string
    children?: React.ReactNode
}

const Button:React.FC<ButtonType> = ({onClick, color, children, title}) => {


    return (
        <div>
            <button onClick={onClick}>{title}</button>
        </div>
    );
};

export default Button;
